input = "



"

class Keycode
  attr_accessor :keycode
  def initialize(input)
    #@keypad = [[1,2,3],[4,5,6], [7,8,9]]
    @keypad = [[nil,nil,1,nil,nil],[nil,2,3,4,nil], [5,6,7,8,9], [nil,"A","B","C",nil], [nil,nil,"D",nil,nil]]
    @ins_lines = input.split(/\n/).map{|ins| ins.split(//)}
    @pointer = [0,2]
    @keycode = ""
  end
  def move_pointer
    @ins_lines.each do |inst|
      inst.each { |i| self.send(i)}
      @keycode << @keypad[@pointer[1]][@pointer[0]].to_s
      puts @keycode

    end
  end
  def U
    @pointer[1] -= 1 if @pointer[1] > 0 &&@keypad[@pointer[1]-1][@pointer[0]]
    #puts "U #{@keypad[@pointer[1]][@pointer[0]].to_s}"
  end
  def D
    @pointer[1] += 1 if @pointer[1] < 4 && @keypad[@pointer[1]+1][@pointer[0]]
    #puts "D #{@keypad[@pointer[1]][@pointer[0]].to_s}"
  end
  def L
    @pointer[0] -= 1 if @pointer[0] > 0 && @keypad[@pointer[1]][@pointer[0]-1]
    #puts "L  #{@keypad[@pointer[1]][@pointer[0]].to_s}"
  end
  def R
    @pointer[0] += 1 if @pointer[0] < 4 && @keypad[@pointer[1]][@pointer[0]+1]
    #puts "R #{@keypad[@pointer[1]][@pointer[0]].to_s}"
  end
end

k = Keycode.new(input)
k.move_pointer
puts k.keycode
